import Header from './Header';

function Login({

   }) 
   {

    return (
        <>
        <Header menu='Регистрация'/>

        <main className="content">

        <form className="login__form">
          <p className="login__signup">Вход</p>
          <input required id="email" name="email" type="email" placeholder='Email'/>
          <input required id="password" name="password" type="password" placeholder='Пароль'/>
          <div className="login__button-container">
            <button type="submit" className="signup__link">Зарегистрироваться</button>
          </div>
        </form>
        <div className="login__welcome">
          <p>Уже зарегистрированы?</p>
          {/* <Link to="/register" className="login__link">Войти</Link> */}
        </div>

        </main>
        </>
    )
};

export default Login
